                <fieldset id="sign_up" class="ba b--transparent ph0 mh0">
                    <legend className="f4 fw6 ph0 mh0">Sign Up</legend>
                    <div class="mt3">
                        <input className="pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" onChange={this.handleChange} value={this.state.email} type="text" name="email" placeholder= "email"/>
                    </div>
                    <div class="mv3">
                        <input className ="b pa2 input-reset ba bg-transparent hover-bg-black hover-white w-100" onChange={this.handleChange} value={this.state.password} type="password" name="password" placeholder="password"/>
                    </div>
                    </fieldset>
                    <div>
                        <input className="b ph3 pv2 input-reset ba b--black bg-transparent grow pointer f6 dib" type="submit" value="Sign Up"/>
                    </div>

                    <div className="lh-copy mt3">
                        <Link to= '/login' >
